import React from "react";
import { ReactDOM } from "react";

function Login()
{
    return (
        <div>
    <h1>Login</h1>

    <form>
        <label for="id">ID:</label>
        <input type="text" id="id" name="id" required></input><br></br>

        <input type="submit" value="Login"></input>
    </form>

        </div>
    );
}

export default Login;
